import React from 'react'
import { Card, Col, Container, Row } from 'react-bootstrap';
import { useLocation } from 'react-router-dom'

const CaballerizaDetail = () => {
  const location=useLocation();
  console.log(location.state);
  const {props:{entrenador,veterinario,numero,total,disponible}}=location.state;
  console.log(entrenador);
  console.log(veterinario);
  console.log(numero);
  console.log(total);
  console.log(disponible);
  return (
   <Container>
    <Row>
      <Col className='justify-content-center align-items-center mx-5'>
      <Card>
        <Card.Body>
          <Row className='row align-content-center'>
            <Col className='col col-auto' style={{ backgroundColor: "#6376D4" }}>
              <h1>{`Caballeriza Nro. ${numero}`}</h1>
            </Col>
          </Row>
        </Card.Body>
      </Card>
      </Col>
    </Row>
   </Container>
  )
}

export default CaballerizaDetail
